import "./navbar.css";
import React from "react";
import Logo from "../../images/SquareArt.png";
import { NavLink, Link } from "react-router-dom";

class Navbar extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    menuButton() {
        document.getElementsByClassName("container")[0].classList.toggle("change");
        document.getElementsByClassName("navigation")[0].classList.toggle("show");
        document.querySelector("nav").classList.toggle("nav-vertical");

    }

    render() {
        return (
            <nav>
                <div className="logo">
                    <Link className="logo-title" to="/">
                        <img src={Logo} width="50" height="50" alt="Square Art logo" />
                        <span className="title">Square Art</span>
                    </Link>
                </div>
                <div className="menu">
                    <div className="container" onClick={(e) => this.menuButton()}>
                        <div className="bar1"></div>
                        <div className="bar2"></div>
                        <div className="bar3"></div>
                    </div>
                    <div className="navigation">
                        <NavLink to="/" onClick={(e) => this.menuButton()}>Home</NavLink>
                        <NavLink to="/gallery" onClick={(e) => this.menuButton()}>Art Gallery</NavLink>
                        <NavLink to="/faq" onClick={(e) => this.menuButton()}>FAQ</NavLink>
                        <NavLink to="/contact" onClick={(e) => this.menuButton()}>Contact Us</NavLink>
                        <Link id="login" to="/login" onClick={(e) => this.menuButton()}>
                            Login
                        </Link>
                        <Link id="register" to="/register" onClick={(e) => this.menuButton()}>
                            Register
                        </Link>
                    </div>
                </div>
            </nav>
        );
    }
}

export default Navbar;
